import React from 'react'
import useMenus from '../data/useMenus'


const MenusPrimary = () => {
    var menuData = '';
    const menusInfo = useMenus();
    menusInfo.map(item => (
        menuData = item
    ))
    if (menuData.length > 0 ) {
        return (
            menuData.map(item => (
                item.locations == "PRIMARY" ? (
                    <ul>
                        <li key={item.id}>{item.locations}</li>
                    </ul>
                ) : null
            ))
        )
    }
}

export default MenusPrimary
